            onChange={(e) => onValueChange(e)}          />
            <TextField
            autoFocus
            margin="dense"
            id="phone"
            label="Phone"
            type="phone"
            fullWidth
            variant="standard"
            onChange={(e) => onValueChange(e)}          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button  onClick={() => addUserDetails()}>Save</Button>
        </DialogActions>
      </Dialog>
     </div>
    </>
  )
